import React from "react";
import { useState, useEffect } from "react";

const ShowTopics = () => {
  const [data, setData] = useState([]);

  async function fetchInfo() {
    console.log("fetch obj is called....");

   fetch(
      "https://localhost:8443/onlineexam/control/topicMasterList"
    ).then((response=>{
       let listoftopics= response.json();
       console.log("list of topics...." , listoftopics);
        setData(listoftopics.ListOfTopic);
        console.log('state datas...',data);
    })).then((data)=>{
        console.log("data",data);
    })
    .catch(err=>console.log(err));
    // console.log("myexamdata..", text.ListOfTopic);
  }

  useEffect(() => {
    fetchInfo();
  }, []);

  return (
    <div className="container">
      <div className="col-8">
        <table className="table table-striped">
          <thead>
            <tr>
              <th>TopicId</th>
              <th>TopicName</th>
            </tr>
          </thead>

          <tbody>
            {
            data
              ? data.map((obj, value) => (
                  <tr>
                    <td>{obj.topicId}</td>
                    <td>{obj.topicName}</td>
                    <td>
                      <button className="btn btn-primary">Edit</button>
                    </td>
                    <td>
                      <button
                        className="btn btn-danger"
                        // onClick={() => deleteRows(value)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))
              : ""}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ShowTopics;
